import React from 'react';
import { useLocation } from 'react-router-dom';
import { Helmet } from 'react-helmet';
import DashboardCard from './DashboardCard';
import ReportCard from './ReportCard';
import './maskgroup.css';
import PieChart from './PieChart';

const Maskgroup = () => {
  const location = useLocation();
  const { data, feature, sub_feature } = location.state;

  // Example data for pie chart
  const pieChartData = [data.results.total_score, 100 - data.results.total_score];

  // Example cardsData based on response
  const cardsData = [
    { title: 'Viewport Evaluation', value: data.results.viewport_evaluation, percentage: '', className: 'maskgroup-dashboardcard1' },
    { title: 'Responsive Images', value: data.results.responsive_images_evaluation, percentage: '', className: 'maskgroup-dashboardcard4' },
    { title: 'Lazy Loading', value: data.results.lazy_loading_evaluation, percentage: '', className: 'maskgroup-dashboardcard5' },
    { title: 'Media Queries', value: data.results.media_queries_evaluation, percentage: '', className: 'maskgroup-dashboardcard6' },
    { title: 'Flexible Layouts', value: data.results.flexible_layouts_evaluation, percentage: '', className: 'maskgroup-dashboardcard7' },
    { title: 'Touch-friendly Design', value: data.results.touch_friendly_evaluation, percentage: '', className: 'maskgroup-dashboardcard8' },
    { title: 'Responsive Typography', value: data.results.responsive_typography_evaluation, percentage: '', className: 'maskgroup-dashboardcard9' },
    { title: 'Total Score', value: data.results.total_score, percentage: '', className: 'maskgroup-dashboardcard10' },
  ];

  // Example reportsData
  const reportsData = [
    { date: '02 Feb 2023', title: 'Report 1', description: "Brainstorming brings team members' diverse experience into play.", className: 'maskgroup-card1' },
    { date: '02 Feb 2023', title: 'Report 2', description: "Brainstorming brings team members' diverse experience into play.", className: 'maskgroup-card2' },
  ];

  // Example one-liner information
  const oneLinerData = [
    "Viewport Evaluation: " + data.results.viewport_evaluation,
    "Responsive Images: " + data.results.responsive_images_evaluation,
    "Lazy Loading: " + data.results.lazy_loading_evaluation,
    "Media Queries: " + data.results.media_queries_evaluation,
    "Flexible Layouts: " + data.results.flexible_layouts_evaluation,
    "Touch-friendly Design: " + data.results.touch_friendly_evaluation,
    "Responsive Typography: " + data.results.responsive_typography_evaluation,
    "Total Score: " + data.results.total_score,
  ];

  return (
    <div className="maskgroup-container1">
      <Helmet>
        <title>Web Analyzer Report</title>
      </Helmet>
      <div className="maskgroup-maskgroup">
        <div className="maskgroup-dashbaord">
          {cardsData.map((card, index) => (
            <DashboardCard
              key={index}
              title={card.title}
              value={card.value}
              percentage={card.percentage}
              className={card.className}
            />
          ))}
          <div className="maskgroup-dashboardcard2">
            <div className="maskgroup-container2">
              <span className="maskgroup-text193">
                <span>Report Data</span>
              </span>
            </div>
            <div className="maskgroup-chart">
              <PieChart data={pieChartData} />
            </div>
          </div>
          <div className="maskgroup-dashboardcard3">
            <span className="maskgroup-text228">
              <span>One Liner Information</span>
            </span>
            <div className="maskgroup-frame427318883">
              {oneLinerData.map((info, index) => (
                <span key={index} className={`maskgroup-text${230 + index * 2}`}>
                  {info}
                </span>
              ))}
            </div>
          </div>
          <div className="maskgroup-block">
            <span className="maskgroup-text244">
              <span>Recent Reports</span>
            </span>
            {reportsData.map((report, index) => (
              <ReportCard
                key={index}
                date={report.date}
                title={report.title}
                description={report.description}
                className={report.className}
              />
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Maskgroup;
